import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { RegisterService } from 'src/app/Services/register.service';

@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.css']
})
export class RegisterComponent {

  constructor(private service:RegisterService, private router: Router){}

  Register(name:any, email:any, phone:any, snn:any){
    if (name && email && phone && snn) { // Check if all required fields have data
      let newReg = {name , email , phone, snn};
      this.service.AddNewRegister(newReg).subscribe();
      // Navigate to home component after adding the new student
      this.router.navigate(['/']);
    }
  }
}
